import React from 'react'
import { useFeed } from './util/hooks'

const Feed = () => {
  const { feed } = useFeed()

  console.log(feed)

  return feed ? (
    <>
      <ul>
        {feed.map((item, i) => (
          <li key={i}>
            <p>
              {item.text}
              {item.author}
            </p>
          </li>
        ))}
      </ul>
    </>
  ) : null
}

export default Feed
